import React from 'react';
import { Card } from 'react-bootstrap';

const VoziloCard = ( { Vozilo }) => {
  return (
    <>
    <Card style={{ width: '18rem'}}>
        <Card.Body>
            <Card.Title>Naslov</Card.Title>
            <Card.teks>
                neki tekst o sutomobilima
            </Card.teks>
        </Card.Body>
    </Card>
    </>
  )
}

export default VoziloCard
